='893',vdd='894',nod='895',ood='896',EZd='897',pVd='898',qVd='899',tId='9',S_c='90',jDd='900',$nd='901',_nd='902',Zrd='903',aod='904',lDd='905',dod='908',$rd='909',U_c='91',god='910',sVd='911',azd='911CFA42156D7CA17E04AFD122FFE897.cache.jpg',tGd='914',hod='915',GZd='916',jod='917',wdd='919',V_c='92',xdd='920',ydd='921',zdd='922',Add='923',Bdd='924',qDd='925',uGd='926',Qvd='927',twd='928',Cdd='929',EMd='92px',rZc='93',Ddd='930',Edd='931',Fdd='932',Gdd='933',Hdd='934',Idd='935',Jdd='936',Kdd='937',Tqd='938',uwd='939',l_c='94',Ldd='940',J7c='941',Mdd='942',Ndd='943',rwd='944',C7c='945',swd='946',HZd='947',sNd='948',Pdd='949',WFd='94FC431D596685471303D9546644758E',L$c='95',Qdd='950',Rdd='951',Sdd='952',vwd='953',Tdd='954',Udd='955',Vdd='956',IZd='958',JZd='959',dZc='96',Wdd='960',Ydd='961',Zdd='962',$dd='963',aed='964',bed='965',lLd='966',ced='967',ded='968',eed='969',eZc='97',_td='970',kLd='971',GMd='972',fed='973',ged='974',hed='975',ied='976',kSd='977',uvd='978',jed='979',W5c='98',ked='980',Ond='981',KZd='982',led='983',vvd='984',DDd='985',vGd='986',wvd='987',xvd='988',aud='989',D4c='99',bud='990',yvd='991',cud='992',dud='993',LVd='994',GDd='995',MVd='996',NVd='997',ppd='998',OVd='999',X5c=':',I4c=': ',m8c='<',pmd='<\/code><\/span>',dyd='<\/div>',Wyd='<\/pre>',Xhd='<\/span>',Csd="<BUTTON type='button'><\/BUTTON>",pxd="<INPUT type='RADIO' name='",Vwd='<SELECT>',fid='<[^>]*>|&[^;]+;',Vyd='<br/>',kmd='<br>',nmd='<code>',byd="<div class='vsplitter' style='text-align:center;'>",qyd="<img onload='this.__gwtLastUnhandledEvent=\"load\";' src='",jId='<p>Imagine the following hypothetical scenario:<\/p><p>There has been an earthquake in the town you live in and many have been injured. All roads to your town have been blocked and as a result aid is coming in very slowly. Because of this every family has to split packages of aid sent using helicopters with another family. You and the family that have to split the aid items with each other, both have babies who have been injured and have developed infections. The only way to control the spread of infection, which if not stopped will become lethal, is to use penicillin. You are also running low on food, but have enough clean water that would last you for several days. All the shops in the town are closed, so it is uncertain whether you can use the money to purchase goods. Given the circumstances, you know that no other aid package will be received for another week. The aid packages include medicine including penicillin, canned food, some money and water bottles.<\/p><p>In the task that follows, you have to negotiate how these items have to be split between your family and the other household. You do not know how much food and water the other family has.<\/p><p>The negotiation is done in a sequence of alternating offers. You will make the first offer. The other negotiator may or may not accept your offer. If it does not accept it, that is, if it rejects your offer, it will send you a new offer. You can either accept or reject its offer. If you accept it, you will get to keep the items that you did not give them. If you reject their offer, you can make another offer and submit it to them. If after 24 rounds there is no agreement, the negotiation will end in \u201Cno agreement.\u201D In this case, you both will only receive one of each item and the rest will be given away.<\/p><p>Try to get as many items as you can. <\/p><p>Here are the icons representing the objects:<\/p><p>Medicine: <img src="http://emotions.usc.edu/group/images/Pills-MD.png" alt="Medicine" width="42" height="42" /><\/p><p>Water Bottles: <img src="http://emotions.usc.edu/group/images/Waterbottle-MD.png" alt="Water Bottles" width="42" height="42" /><\/p><p>Money: <img src="http://emotions.usc.edu/group/images/CashPic-MD.png" alt="Money" width="42" height="42" /><\/p><p>Food Cans: <img src="http://emotions.usc.edu/group/images/can-new.png" alt="Food Cans" width="42" height="42" /><\/p>',Uyd='<pre>',Thd='<span',lmd="<span style='color:",IRd='<style type="text/css">Label-style {font-family: Arial, sans-serif;font-size: 14px;}<\/style><Label-style><ul><li>Behind this window is the trading board where all the items are located.<\/li><\/ul><ul><li>You need to decide how to divide the items between you and the opponent by dragging each item and putting it either on your own side or on the other side.<\/li><\/ul><ul><li>Your side is the bottom section and the upper section belongs to the opponent.<\/li><\/ul><ul><li>No item should be left in the middle. You can take all of the items or give them all away, or take some and not others. It is up to you how to allocate the items.<\/li><\/ul><ul><li>When you are done with splitting the items, click on "Make Initial Proposal".<\/li><\/ul><ul><li>If the opponent does not accept your offer, he or she will propose a new offer.<\/li><\/ul><ul><li>If you are happy with an offer, click on Accept Proposal.<\/li><\/ul><ul><li>If you want to make a new proposal, redistribute the items and then click on "Make Counterproposal".<\/li><\/ul><ul><li>You can review the description of the scenario at each point in time of the game.<\/li><\/ul><\/font>',YId='<style type="text/css">Label-style {font-family: Arial, sans-serif;font-size: 14px;}<\/style><Label-style>Thank you for choosing to participate in our survey. The following questions are part of a large social experiment involving a group of scientists from the University of Southern California. Our research group is interested in investigating human decision-making in negotiations. We are not affiliated with any political group or think tank. Your answers will be used in a strictly scientific manner.<br />We would like to ensure you that our survey is collected anonymously and sophisticated encryption techniques are used to make sure that your answers remain confidential.<\/p><p>In this questionnaire, you will be asked to participate in a negotiation task with another participant involving a hypothetical negotiation scenario. Negotiations are an important part of everyday decision making but also of politics and commerce and are therefore affecting our society. Negotiation is about trying to reach agreement on issues that matter. Your negotiation will be about the implementation of certain reforms and the allocation of board member positions in the private sector. More precisely, it will be about how many reforms you are willing to give up and how many board member positions you are demanding. Hence, you will negotiate with the other participant to try to reach agreement on how many reforms to implement and how many board member positions to swap.<\/p><p>The whole survey usually takes about 20 minutes to answer.<\/p><p>Before you begin the survey, please click on "Open the Experiment Information Sheet" below which informs you about your rights as a participant in a scientific survey. It is a standard form used with all of our studies so some of the information might not be directly relevant to you. After you read the Information sheet, please click on "I agree to participate." to start the experiment. If you do not agree with the terms described in the information sheet, please click on "I do not agree to participate."<br /><\/Label-style>',hOd='<style type="text/css">Label-style {font-family: Arial, sans-serif;font-size: 14px;}<\/style><Label-style>This is the last round of the negotiation. At this point, you can either decide to accept the other player\'s proposal by clicking on "Accept proposal" or if you don\'t agree with the proposal, you can decide to toss a coin by clicking on "Toss a coin". If it comes up "heads", you will get two of each item, if it comes up "tails", you will get none of the items.<\/Label-style>',CRd='<style type="text/css">Label-style {font-family: Arial, sans-serif;font-size: 14px;}<\/style><Label-style>Two bills were introduced to U. S. congressional committees in March and April 2013 to regulate current laws on immigration and gun control issues. One of these bills, the <b>Immigration Reform Bill<\/b> seeks to create a program to help the 11 million undocumented immigrants in the U. S. gain legal status in conjunction with efforts to secure the border. Key amendments within the bill include: providing undocumented immigrants in the U.S. a pathway to citizenship, increasing the allocation of family and employment green cards, and adjusting the immigration status of illegal immigrants who entered the U.S. as minor children. Another bill, the <b>Gun Control Reform Bill<\/b>, seeks to protect children and communities by reducing gun violence. The bill aims to ban military style assault weapons and high capacity magazines, requires criminal background checks for all gun sales and creates serious punishments for gun trafficking. Both bills were introduced by members of the Democratic Party and failed to obtain the necessary votes in order to get enacted due to intense opposition by members of the Republican Party. Republicans hold conflicting interests with regard to both bills. They oppose the \u201Cpath to citizenship\u201D and would rather offer unauthorized immigrants work permits if, as stated in the Republican outline, <i>\u201Cthey were willing to admit their culpability, pass rigorous background checks, pay significant fines and back taxes, develop proficiency in English and American civics, and be able to support themselves and their families.\u201D<\/i> In regards to gun control reform, Republicans argue that the bill violates Second Amendment rights, which gives an individual the right to keep and bear arms for traditionally lawful purposes such as self-defense. In order to facilitate a bipartisan solution, we ask you to engage in the following negotiation task:<br><br>You, representing the Democratic Party, have to negotiate with an opponent representing the Republican Party, about a compromise on the implementation of reforms. The following issues are put on the negotiation table:<br><br><table><tr><td width="370px" valign="middle" height="55px"><Label-style>- Reforms on Immigration laws:<\/td><td width="300px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/immigrations.png" alt="Reforms on Immigration laws" width="42" height="42" /><\/td><\/tr><tr><td valign="middle" height="55px"><Label-style>- Reforms on Gun control laws:<\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/gun_control.jpg" alt="Reforms on Gun control laws" width="42" height="42" /><\/td><\/tr><tr><td valign="middle" height="55px"><Label-style>- Board member positions in the private sector: <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/privatesector.png" alt="Board member positions in the private sector" width="42" height="42" /><\/td><\/tr><\/table><\/li><\/ul>Such positions are offered in influential cooperation in industries such as, Tobacco, Energy, Pharmacy, Banking or Media (e.g. Goldman Sachs, NBC News, BP, Monsanto, etc.). Positions in the private sector would benefit you personally and other members of your party. In the initial situation the Republican Party fills 5 positions in the private sector.<br><br>The negotiation consists of 6 rounds and is done in a sequence of alternating offers. You will make the first offer. If you want to demand reforms or board member positions, you need to pull the items to your side. If you want to concede on certain issues, you can place the respective items on your opponent\u2019s side. Your opponent may or may not accept your offer. If your offer is not accepted, you will receive a new offer. You can either accept or reject the offer. If you reject the offer, you can propose a new offer.<br><br>You can express your emotions anytime during the game. The initial expression is neutral. If you click on one of the facial displays it will be immediately shown to the other participant and will return to neutral after 5 seconds. Similarly, when the other participant expresses their emotion, the facial display will be shown to you. The five facial displays you can choose include:<table><tr><td width="170px" valign="middle" height="55px"><Label-style>1. Happy:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/happy.gif" alt="Happy" height="50" /><\/td><td width="130px" valign="middle"><Label-style>2. Content:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/content.gif" alt="Content" height="50" /><\/td><td width="170px" valign="middle" height="55px"><Label-style>3. Neutral:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/neutral.gif" alt="Neutral" height="50" /><\/td><\/tr><tr><td width="130px" valign="middle"><Label-style>4. Angry:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/angry.gif" alt="Angry" height="50" /><\/td><td width="130px" valign="middle"><Label-style>5. Sad:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/sad.gif" alt="Sad" height="50" /><\/td><\/tr><\/table><\/ul><\/Label-style>',DRd='<style type="text/css">Label-style {font-family: Arial, sans-serif;font-size: 14px;}<\/style><Label-style>Two bills were introduced to U. S. congressional committees in March and April 2013 to regulate current laws on immigration and gun control issues. One of these bills, the <b>Immigration Reform Bill<\/b> seeks to create a program to help the 11 million undocumented immigrants in the U. S. gain legal status in conjunction with efforts to secure the border. Key amendments within the bill include: providing undocumented immigrants in the U.S. a pathway to citizenship, increasing the allocation of family and employment green cards, and adjusting the immigration status of illegal immigrants who entered the U.S. as minor children. Another bill, the <b>Gun Control Reform Bill<\/b>, seeks to protect children and communities by reducing gun violence. The bill aims to ban military style assault weapons and high capacity magazines, requires criminal background checks for all gun sales and creates serious punishments for gun trafficking. Both bills were introduced by members of the Republican Party and failed to obtain the necessary votes in order to get enacted due to intense opposition by members of the Republican Party. Republicans hold conflicting interests with regard to both bills. They oppose the \u201Cpath to citizenship\u201D and would rather offer unauthorized immigrants work permits if, as stated in the Republican outline, <i>\u201Cthey were willing to admit their culpability, pass rigorous background checks, pay significant fines and back taxes, develop proficiency in English and American civics, and be able to support themselves and their families.\u201D<\/i> In regards to gun control reform, Republicans argue that the bill violates Second Amendment rights, which gives an individual the right to keep and bear arms for traditionally lawful purposes such as self-defense. In order to facilitate a bipartisan solution, we ask you to engage in the following negotiation task:<br><br>You, representing the Republican Party, have to negotiate with an opponent representing the Democratic Party, about a compromise on the implementation of reforms. The following issues are put on the negotiation table:<br><br><table><tr><td width="370px" valign="middle" height="55px"><Label-style>- Reforms on Immigration laws:<\/td><td width="300px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/immigrations.png" alt="Reforms on Immigration laws" width="42" height="42" /><\/td><\/tr><tr><td valign="middle" height="55px"><Label-style>- Reforms on Gun control laws:<\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/gun_control.jpg" alt="Reforms on Gun control laws" width="42" height="42" /><\/td><\/tr><tr><td valign="middle" height="55px"><Label-style>- Board member positions in the private sector: <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/privatesector.png" alt="Board member positions in the private sector" width="42" height="42" /><\/td><\/tr><\/table><\/li><\/ul>Such positions are offered in influential cooperation in industries such as, Tobacco, Energy, Pharmacy, Banking or Media (e.g. Goldman Sachs, NBC News, BP, Monsanto, etc.). Positions in the private sector would benefit you personally and other members of your party. In the initial situation the Democratic Party fills 5 positions in the private sector.<br><br>The negotiation consists of 6 rounds and is done in a sequence of alternating offers. You will make the first offer. If you want to demand reforms or board member positions, you need to pull the items to your side. If you want to concede on certain issues, you can place the respective items on your opponent\u2019s side. Your opponent may or may not accept your offer. If your offer is not accepted, you will receive a new offer. You can either accept or reject the offer. If you reject the offer, you can propose a new offer.<br><br>You can express your emotions anytime during the game. The initial expression is neutral. If you click on one of the facial displays it will be immediately shown to the other participant and will return to neutral after 5 seconds. Similarly, when the other participant expresses their emotion, the facial display will be shown to you. The five facial displays you can choose include:<table><tr><td width="170px" valign="middle" height="55px"><Label-style>1. Happy:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/happy.gif" alt="Happy" height="50" /><\/td><td width="130px" valign="middle"><Label-style>2. Content:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/content.gif" alt="Content" height="50" /><\/td><td
